import React from 'react';
import styles from './ButtonBuy.module.css'

const ButtonBuy = (props) => {
    return (
        <button onClick={props.onClick} className={styles.buttonBuy}>
            <span className={styles.buttonBuy__name}>
                {props.name}
            </span>
        </button>
    );
};

export default ButtonBuy;
